import React from 'react';
import './App.css';

import { Switch, Route } from 'react-router-dom';
import Home from './pages/Home';
import PartyComp from './pages/Party';
import { UserProvider } from './contexts/UserContext';


function App() {
  return (
    <UserProvider>
        <div className="App">
          <header className="App-header">
          </header>
          <Switch>
            <Route exact path='/'>
              <Home></Home>
            </Route>
            <Route path='/party/:id'>
              <PartyComp />
            </Route>
          </Switch>
        </div>
    </UserProvider>
  );
}

export default App;
